// creatind 2 hashmaps and comaparing them to slide our sliding  window
#include<iostream>
#include<string>
#include<unordered_map>
using namespace std;
string minWindow(string s,string t)
{ 
    unordered_map<char,int> countT;
    unordered_map<char,int> window_map;
    pair<int,int> result(-1,-1); // initializing result to max value which is firwst and last index of s
    int resultLen= INT32_MAX;
    for(auto eachChar:t)
    {
        countT[eachChar]++;
        //cout<<"char-"<<eachChar<<" count-"<<countT.find(eachChar)->second<<endl;
    }
    int haveCount=0;
    int needCount=countT.size(); // elemets can be duplicate so hasCount will be determined by hashmap size
    int left=0;
    int right=0;
    for (right = 0; right < s.size(); right++)
    {
        window_map[s[right]]++; // iserting right window element in hashmap
        //  inserted element exists in T and count is also equal to t then -> update have vount
        cout<<"Inserted Element "<<s[right]<<endl;
        if (countT.find(s[right])!=countT.end() && window_map.find(s[right])->second==countT.find(s[right])->second) // if element exists in countT hashmap
        {
            haveCount++;
            cout<<"Increating Have count"<<endl;
        }
        // if all  substring elements exist in windowmap then  update result
        // hasCount contains count of common elements in window that also exists in countT
        while (haveCount==needCount)  
        {
            if ((right-left+1)<resultLen)
            {
                resultLen=right-left+1;
                result.second=right;
                result.first=left;
                cout<<"Updating Result  values to"<<result.first<<" "<<result.second<<endl;
            }
            cout<<"removing  "<<s[left]<<endl;
            window_map[s[left]]--; // removing left element from map
            // checking  if element we removed exists in count and if removing the count decreses its value than the value in countT  map for same  element
            if (countT.find(s[left])!=countT.end() && window_map.find(s[left])->second < countT.find(s[left])->second)
            {
                haveCount--;
            }
            left++;           
        }    
    }
    if (resultLen==INT32_MAX)
        {
            string temp="";
            return  temp;
        }
        else
        {
            cout<<"left-"<<result.first<<" right-"<<result.second<<endl;
            return s.substr(result.first,result.second-result.first+1);
        }
}
int main()
{
    // string s="ADOBECODEBANC";
    // string t="ABC";
    // cout<<minWindow(s,t);
    string s="";
    string t="";
    cout<<minWindow(s,t);
}